    access_token: String,
    expires_in: i64,
    token_type: String,
}

#[derive(Serialize, Deserialize, Debug)]
struct TextToSpeechResponse {
    audio_content: String,
}

struct ElevenLabsClient {
    client: Client,
    api_key: String,
}

impl ElevenLabsClient {
    fn new(api_key: &str) -> Self {
        Self {
            client: Client::new(),
            api_key: api_key.to_string(),
        }
    }

